s, you will need to prove the following for all people listed on your tax return:   Identity and age: such as photo ID, address and ID number (EIN or SSN).  Proof of Health Insurance coverage for all family members. Forms 1095-A, B or C.','required_document',NULL,NULL,'recKZLWjxbJE6erUW,recx4qcPTy323zbi0',NULL,NULL),(57,'recJRxp6kA8JsNEDs','Pregnant & new parents','eligibility',NULL,NULL,'recvUmZMw7IVJUaTP,recw4sudhX7ReYkaw,recpFPH7qLtSCVS0D,recArNrj7cBmkDUd8,recYoDoMsjj0H5biJ',NULL,NULL),(58,'recJYXdEI8GKsjBEr','S2R026','program_code',NULL,NULL,'recYoDoMsjj0H5biJ',NULL,NULL),(59,'recJZpDXBza6D7Nrx','IDNYC uses a point system to prove your identity and where you live. To apply, you will need to provide:   Proof of your identity: at least three (3) points.  Proof of where you live: one (1) point.  At least one (1) of your documents much have your photo.  At least one (1) document with your date of birth.    If you are between the ages 14-21 and/or disabled and do not have a enough points or a photo ID you can apply with a caretaker.   Use the <a href=\"http://www1.nyc.gov/site/idnyc/card/documentation.page\" target=\"_blank\">IDNYC Document Calculator</a> to see what documents you can use.<br>','required_document',NULL,NULL,'recz6QsP9kF11u3M0',NULL,NULL),(60,'recK8JDIXaTfITOev','P008en','uid',NULL,NULL,'recIFi382T0swsNjO',NULL,NULL),(61,'recKWZzUgzd7Owzwh','P021en','uid',NULL,NULL,'recw4sudhX7ReYkaw',NULL,NULL),(62,'recKp8y8G4nhymDbt','P042en','uid',NULL,NULL,'recLHNlRuEPPT6asc',NULL,NULL),(63,'recKsG5WaHzzHzy8K','Each health insurance program will require different documents to enroll. Once you decide what insurance option you will enroll in, they will tell you what documents you will need to apply.','required_document',NULL,NULL,'rec6WjnDQeMuEfYH6',NULL,NULL),(64,'recL4RWqaJsU5AiMb','P016en','uid',NULL,NULL,'recQdBFP5hSwLxI80',NULL,NULL),(65,'recLSM7m8RAJtTCVW','S2R007','program_code',NULL,NULL,'rec8N0qhVbdoQt1j8',NULL,NULL),(66,'recLmCSWJDzGxesNc','To file for une