INSERT INTO `organizations` VALUES (1,'rec6Zz5itRYONnAUH','Mayor\'s Office to Combat Domestic Violence',NULL,NULL,'The Mayor\'s Office to Combat Domestic Violence (OCDV) formulates policies and programs, coordinates the citywide delivery of domestic violence services and works with diverse communities and community leaders to increase awareness of domestic violence. OCDV collaborates closely with government and nonprofit agencies that assist domestic violence survivors and operates the New York City Family Justice Centers. These co&#8208;located multidisciplinary domestic violence service centers provide vital social service, civil legal and criminal justice assistance for survivors of intimate partner violence and their children under one roof.',NULL,'http://www1.nyc.gov/site/ocdv/index.page',NULL,NULL,NULL,NULL,'rec8Vqish0PchARPy',NULL,NULL,NULL,NULL,NULL),(2,'rec8jXgLDYhBydxPR','INCLUDEnyc',NULL,NULL,'INCLUDEnyc brings love, equity, and access to young people with all disabilities in New York City by providing them and their families with the resources and support they need. \n\nWe give young people with disabilities from birth to 26 and their families the knowledge, confidence, and skills they need to make informed decisions, effectively access and navigate systems and services, and the ability to advocate for themselves and other young people. \n',NULL,'http://www.includenyc.org/',NULL,NULL,NULL,NULL,NULL,NULL,'recfSz4yvRfAhQ5oI','reco66jEVm1Q054ZL',NULL,NULL),(3,'rec9pOaqf44WDhnDK','NYC Housing Authority',NULL,NULL,'The New York City Housing Authority\'s mission is to increase opportunities for low- and moderate-income New Yorkers by providing safe, affordable housing and facilitating access to social and community services. More than 400,000 New Yorkers reside in NYCHA\'s 326 public housing developments across the City&rsquo;s five boroughs. Another 235,000 receive subsidized rental assistance in private homes through the NYCHA-administered Section 8 Leased Housing Program.',NULL,'http://www1.nyc.gov/site/nycha/index.page',NULL,NULL,NULL,NULL,'recqyQwLMaOs7ntLA,recBx7xDKcWhUiCJe',NULL,NULL,NULL,NULL,NULL),(4,'recA5vgnROOnAUDYO','12',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recW7JqQ6e5rKhav5,recLISIuX3LejQyBf,recgfdj5Vxtnvbo0J,recX15k77qx1vr57A,recoiNklLhmCv40RJ,receUkLkC7X5lrk2g',NULL,NULL,NULL),(5,'recBdM9XB8OSyAbYU','NYC Department of Consumer Affairs / IRS',NULL,NULL,'The NYC Department of Consumer Affairs (DCA) protects and enhances the daily economic lives of New Yorkers to create thriving communities. DCA licenses more than 81,000 businesses in more than 50 industries and enforces key consumer protection, licensing, and workplace laws that apply to countless more. By supporting businesses through equitable enforcement and access to resources and, by helping to resolve complaints, DCA protects the marketplace from predatory practices and strives to create a culture of compliance. Through its community outreach and the work of its offices of Financial Empowerment and Labor Policy & Standards, DCA empowers consumers and working families by providing the tools and resources they need to be educated consumers and to achieve financial health and work-life balance. DCA also conducts research and advocates for public policy that furthers its work to support New York City&rsquo;s communities.',NULL,'https://www1.nyc.gov/site/dca/media/pr011916.page',NULL,NULL,NULL,NULL,'recBe3YJ5Cadf3hBw',NULL,NULL,NULL,NULL,NULL),(6,'recBgSvPsEqULf7Js','14',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recXzY5YtoWV3J0qT,recuFTzzBxf6R4OUY,recCXNpcnXjH5B0m8,recy6nCRnpRm6bB4i',NULL,NULL,NULL),(7,'recCLdoKPCmqhKIGD','5',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recbNgdturSedON4D,recTkhmYgN9EAi4HK,recSSSwevtlx5ygZE,reczEt2POfliaWotd,recWWLdUj9Pt0ZP1U,recOPyJn2oU3X0ZG0,recoIJ9PFlFKx9dR7,recJQCMftDdg99djD',NULL,NULL,NULL),(8,'recCT956wefZN2VR3','378',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'rec9zpR5W7HgnlEyt',NULL,NULL,NULL),(9,'recHgZCEx7HeXQAHQ','NYC Department of Small Business Services',NULL,NULL,'The NYC Department of Small Business Services (SBS) helps unlock economic potential and create economic security for all New Yorkers by connecting New Yorkers to good jobs, creating stronger businesses, and building thriving neighborhoods across the five boroughs.',NULL,'http://www1.nyc.gov/site/sbs/index.page',NULL,NULL,NULL,NULL,'recYoDoMsjj0H5biJ',NULL,NULL,NULL,NULL,NULL),(10,'recK6yF4kUqduEUsq','4',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recUDJOg2QC9K51qZ,recHMYL8ffkqyIMBh,rechNY6LzhWTblzmD,recB3nrQecgaQCrL8,recEHPtFfldnnedsM,recuV9ITd9FeydZpf',NULL,NULL,NULL),(11,'recLdvGgHhZf9aAKy','NYC Department of Finance / NYC Housing Preservation and Development',NULL,NULL,'Established in 1978, the New York City Department of Housing Preservation and Development (HPD) is the largest municipal housing preservation and development agency in the nation. The agency\'s mission is to promote the construction and preservation of affordable, high-quality housing for low- and moderate-income New Yorkers in thriving and diverse neighborhoods across the city. HPD strives to achieve this mission by enforcing housing quality standards, financing affordable housing development and preservation, and ensuring sound management of the City\'s affordable housing stock.',NULL,'http://www1.nyc.gov/site/hpd/index.page',NULL,NULL,NULL,NULL,'receGhOPkKatmhb30,recnCmIL2l4rqOn0Z',NULL,NULL,NULL,NULL,NULL),(12,'recMR46rTfAV2Swc4','NYC Department of Finance',NULL,NULL,'Our Mission: We administer the tax and revenue laws of the City fairly, efficiently and transparently to instill public confidence and encourage compliance while providing exceptional customer service.',NULL,'http://www1.nyc.gov/site/finance/index.page',NULL,NULL,NULL,NULL,'rec5JNtwfiikmUrPV,rece16A3CWxks3Ddm,recb9B2ozdyQs9Uc9',NULL,NULL,NULL,NULL,NULL),(13,'recPyGR7MyTIXepE7','NYS Department of Health',NULL,NULL,'Health departments prevent disease, promote health and protect the public from health problems and hazards.\n\nDo you:\n\nNeed help getting your child immunized?\nNeed to get a rabies vaccine for your pet?\nFeel sick after eating at a restaurant?\nWant to learn about the health needs in your community?\nNeed to report a potential health violation?',NULL,'https://www.health.ny.gov/',NULL,NULL,NULL,NULL,'recByL2qKO5K8WA56,recArNrj7cBmkDUd8',NULL,NULL,NULL,NULL,NULL),(14,'recRIinmE87k5dSFy','NYC Department of Consumer Affairs',NULL,NULL,'The NYC Department of Consumer Affairs (DCA) protects and enhances the daily economic lives of New Yorkers to create thriving communities. DCA licenses more than 81,000 businesses in more than 50 industries and enforces key consumer protection, licensing, and workplace laws that apply to countless more. By supporting businesses through equitable enforcement and access to resources and, by helping to resolve complaints, DCA protects the marketplace from predatory practices and strives to create a culture of compliance. Through its community outreach and the work of its offices of Financial Empowerment and Labor Policy & Standards, DCA empowers consumers and working families by providing the tools and resources they need to be educated consumers and to achieve financial health and work-life balance. DCA also conducts research and advocates for public policy that furthers its work to support New York City&rsquo;s communities.',NULL,'http://www1.nyc.gov/site/dca/index.page',NULL,NULL,NULL,NULL,'rec6ScLSkms4H63fZ',NULL,NULL,NULL,NULL,NULL),(15,'recSiKcJ9bFjoZHUE','15',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recnDyaGp4xBtVcSG,rechVcFXyuqGsyjhy,rec271wMevQZLaPvt,recoq8IAgduCPgixR,rec242susywYAjIc0',NULL,NULL,NULL),(16,'recTZAePFTmBP99in','22',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'rec5ZXhTyUhsBrNEP,recWPlzwUZMQyXezA,recY1CRLRJUEkMKMk,recVYl66rogFmrzyu,recGRVniAvMbsjUUi,recm7bFpXogrup1S7,recV4CtkKbnPVlifl,recwA4GEL6ZH