b seekers to jobs.\n\nWe vigorously enforce state Labor Laws to give businesses that obey the law an even break. We work aggressively to ensure a fair wage for all workers. We protect the safety and health of workers and the public. We help the unemployed via temporary payments (unemployment insurance). We link job seekers with employers. We guide workers to training that will keep New York strong in the world economy.',NULL,'https://www.labor.ny.gov/home/',NULL,NULL,NULL,NULL,'recw4sudhX7ReYkaw',NULL,NULL,NULL,NULL,NULL),(24,'recbwNDTDK0zcXdsz','NYC Department of Health & Mental Hygiene',NULL,NULL,'We\'re one of the largest public health agencies in the world, serving 8 million New Yorkers from diverse ethnic, cultural and economic backgrounds. After more than 200 years of leadership in the field, we\'re also one of our nation\'s oldest public health agencies.\n\nOur work is broad-ranging. You see us in the inspection grades of dining establishments, the licenses that dogs wear, the low- to no-cost health clinics in your neighborhood, and the birth certificates for newborns.',NULL,'http://www1.nyc.gov/site/doh/index.page',NULL,NULL,NULL,NULL,'recepgnJMaoqkfVe5,recpFPH7qLtSCVS0D',NULL,NULL,NULL,NULL,NULL),(25,'recc2mjvcJ6TuR9Yc','8',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recwXOf2qj0Sx3irX,rec8m1Wphg1G9ywaj,rechXau1WzW1DRMS2,recWlAk3cAEUgLQEy,recnqbbnYmdWB5fwO,recDUloLa4XcQFRRX,recy8KLLsv0PSdbP8,rec8k30AoLLFplCol',NULL,NULL,NULL),(26,'recdLfyIv3EvUnJPW','9',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'rec3rg8CbuHm5HurX,recMmAMxI5lRKuqud,recGrniMoKRAWV3N8',NULL,NULL,NULL),(27,'rech6VVk2QkmwZ5El','3',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'reczUv5cC7OIzo46Q,recgHyx0KERpLivDq,recE5raVq32GJ9N0n,recFiyVNByeWhmCSY,recASKqLzNZfKNQ4y,recvdkNGNpveIT9Vd,rec9GRRH7h7QgCpV8,recUkX7PEsTHih8dg,rec1cvVwfpNejzRco,recvRqMDLGsSGIiYY,recEjtjsnneenjKh3,rec1ePufHRBAPtD6c,recVqXfLesgaWEnm5,recPAfoRdqdEcGExG',NULL,NULL,NULL),(28,'recjfINl915wycQyJ','10'