ch and advocates for public policy that furthers its work to support New York City&rsquo;s communities.',NULL,'https://www1.nyc.gov/site/dca/media/pr010417.page',NULL,NULL,NULL,NULL,'recKZLWjxbJE6erUW,recx4qcPTy323zbi0',NULL,NULL,NULL,NULL,NULL),(32,'recr8xCcKucMjThr9','NYC Human Resources Administration',NULL,NULL,'The New York City Human Resources Administration/Department of Social Services (HRA/DSS) is dedicated to fighting poverty and income inequality by providing New Yorkers in need with essential benefits such as Food Assistance and Emergency Rental Assistance.\n\nAs the largest local social services agency in the country, HRA helps over 3 million New Yorkers through the administration of more than 12 major public assistance programs, with more than 14,000 employees and an operating budget of $9.7 billion. ',NULL,'http://www1.nyc.gov/site/hra/index.page',NULL,NULL,NULL,NULL,'reccHjqPbUFuHEoNC,reca8c6a4tWhXlHbi,recbrVTZa9k3UvAUv,recuFygwszKH4OXNp,rec6WjnDQeMuEfYH6,recz6QsP9kF11u3M0,rec8N0qhVbdoQt1j8',NULL,'recNqiOzjtX4uIPuk,rec680G8MZOEjmao5',NULL,NULL,NULL),(33,'recrLCGzIZ5f5BOJV','NYC Metropolitan Transportation Authority','MTA',NULL,'The Metropolitan Transportation Authority is North America\'s largest transportation network, serving a population of 15.3 million people in the 5,000-square-mile area fanning out from New York City through Long Island, southeastern New York State, and Connecticut.',NULL,'http://web.mta.info/',NULL,NULL,NULL,NULL,'recLHNlRuEPPT6asc',NULL,NULL,NULL,'recm3LQy6ASP6H8fK',NULL),(34,'recsDbb3hgL633JgJ','NYS Department of Education',NULL,NULL,'The New York State Education Department is part of the University of the State of New York (USNY), one of the most complete, interconnected systems of educational services in the United States.\n\nOur mission is to raise the knowledge, skill, and opportunity of all the people in New York. Our vision is to provide leadership for a system that yields the best educated people in the world.',NULL,'http://www.nysed.gov/',NULL,NULL,NULL,NULL,'rectECQlf2uLRlWfA,recoL5MmjJVEw2Iyj',NULL,NULL,NULL,NULL,NULL),(35,'recsbyRpUti6VKeIF','NYC Department of Aging',NULL,NULL,'The mission of the Department for the Aging (DFTA) is \"to work for the empowerment, independence, dignity and quality of life of New York City\'s diverse older adults and for the support of their families through advocacy, education and the coordination and delivery of services.\"',NULL,'http://www.nyc.gov/html/dfta/html/home/home.shtml',NULL,NULL,NULL,NULL,'recpopXE0UeU7BzAs',NULL,NULL,NULL,NULL,NULL),(36,'recslDGgzOSXnQHqZ','NYC Department of Health',NULL,NULL,'We\'re one of the largest public health agencies in the world, serving 8 million New Yorkers from diverse ethnic, cultural and economic backgrounds. After more than 200 years of leadership in the field, we\'re also one of our nation\'s oldest public health agencies.\n\nOur work is broad-ranging. You see us in the inspection grades of dining establishments, the licenses that dogs wear, the low- to no-cost health clinics in your neighborhood, and the birth certificates for newborns.',NULL,'http://www1.nyc.gov/site/doh/index.page',NULL,NULL,NULL,NULL,'reclLEE73EugpgZjD',NULL,NULL,NULL,NULL,NULL),(37,'rectGvddaSabWZxbH','17',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recJEKj3AFNjJw7gk,recZL2nEWLm7ADHWK,recUYuRe7hwJ6kJxq,recOtyNYaOddaEXri,rec4hSi3Z3BMX5yEE,recCUh8nCFma9G0zV,recvepqwgk9b71Vhb,recOfxLlIYfE74erY,recciZSVaB0u6Ovfc,recrkIBVDh5FtEYhS,recB5XEBBdorz4pZW,rec1btUqdraLx5J2k,recfgXtw7Oykon1cx,recfQN96X3q8THt3G,recW8bWiFaXLZdXWB,recDL3AcqTn4XZuls,recDSY5dRoZ1mtfEw,recaaRhw5uunuz804,reczcJyAWxJQPOi7b,rec9Ag7zAzqOjBBvI,recdYmbcQIRH02H6a,reccCHu3Rneoa3jK4,recn74zajVK2fXkKU,recEvmQkxCm1aV7hG,recpuPqpPP6uX2hDj,recWkIyqlxaiGHf4u,reclw3lpZBq7lWQk4,recWiRhao2nrCj5TF,recjnQ7SvVWSr9gjM,recDs7LKqRmACCs1y,rec80CVwlJHUGq7Fj,recARjJrBE89q1JNC,recWAZjwOdbdlG3rP',NULL,NULL,NULL),(38,'recv9tdzZQpzv2aVV','2',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NUL