with nearly 1,000 local governments.',NULL,'https://www.tax.ny.gov/',NULL,NULL,NULL,NULL,'rec3RqEpOvgidR06R',NULL,NULL,NULL,NULL,NULL),(42,'recy3BXfUQspaN2bM','377',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recrIVrPipMjBPKuP,rectWEZMdDlVIMJfK',NULL,NULL,NULL),(43,'recy4Mg1D2DeglZ6l','Parent to Parent NY Inc.',NULL,NULL,'Parent to Parent of New York State builds a supportive network of families to reduce isolation and empower those who care for people with developmental disabilities or special healthcare needs to navigate and influence service systems and make informed decisions. ',NULL,'http://parenttoparentnys.org/',NULL,NULL,NULL,NULL,NULL,NULL,'rec1iCSrLj01RCw6c',NULL,NULL,NULL),(44,'recyDlUnKHcFKQUcj','13',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recU3C5RatHRzcP2R',NULL,NULL,NULL),(45,'reczGMNoEX5rTKTSk','7',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recHI53gSC0eAL9vq',NULL,NULL,NULL),(46,'reczGo7d4is5VN2V7','16',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recupHCXEgxxFDraY,recdAf94nCGjRM3NQ',NULL,NULL,NULL),(47,'reczw3O34RQG6RoK9','18',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'recmJ03sOsSLVmuW5,recIVqnbwzKcTqqEe,recBiFKS7BoOkzqZ1,recTkpc8sjXrrvfz5',NULL,NULL,NULL);
