INSERT INTO `pages` VALUES (1,'Home','This is Home111','<h4 style=\"font-family: \" helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><i>myPB uses open data to share local projects brought up by participatory budgeting (PB), so you can explore community needs and spending impact in cities.</i></h4><p><i><br></i></p><p><i></i></p><p><i>We’re piloting in NYC now, and will expand to include demographic data over 2018. Learn about this project <a href=\"http://pb.flospaces.org/about\"><u>here</u></a>.</i></p><hr><h2 style=\"font-family: \" helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\">myPB helps you explore projects that matter to New Yorkers and see how they\'re coming along.</h2><p></p><p>New York City Council has allocated money using PB since 2012. Residents spend $1 million of capital funding towards projects annually in about 60% of City Council Districts.</p><p>Currently about 10% of those projects have public status updates in the <u><a href=\"https://data.cityofnewyork.us/City-Government/Participatory-Budgeting-Projects/wwhr-5ven\" target=\"_blank\">open data</a>, though we expect an update in March 2018</u>.</p><p><br></p><p><a href=\"http://pb.flospaces.org/explore\"><u>Explore</u></a> the projects that New Yorkers have put up for public vote from 2012 - 2017 on the <a href=\"http://pb.flospaces.org/explore\"><u>Explore page,</u></a> and see if you can find out:</p><ul><li>Projects funded near you, in your neighborhood or otherwise</li><li>Projects that stand out to you</li><li>Questions this brings up for you.</li></ul>',NULL,'2018-02-06 17:21:03','2018-05-11 19:25:09',NULL),(2,'About','This is About Page','<h4 style=\"font-family: \" helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\">Welcome to the myPB data hub, where we\'re working to share the impacts of participatory budgeting and enable equitable decisions with public money.</h4><p><br>We\'re piloting within NYC right now using the projects funded by <span style=\"font-weight: 700;\">PBNYC - NYC\'s PB process</span>. Explore projects in NYC using the <a href=\"http://pb.flospaces.org/explore\" target=\"_blank\"><u>explore</u></a> tab, and learn more about <u><a href=\"https://council.nyc.gov/pb/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">PBNYC on their website</a>.</u> <br><br><span style=\"font-weight: 700;\">Participatory Budgeting (PB)</span> is a democratic process in which community members directly decide how to spend part of a public budget in their neighborhood. In the US and Canada 414,000 people have worked together to decide how to spend over $299 Million dollars during the last decade - and we’re just getting started. To advocate to your elected officials to PB, <a href=\"https://myreps.participatorybudgeting.org/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\"><u>get their contact info here.</u></a><br><br></p><h4 style=\"font-family: \" helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><span style=\"font-weight: 700;\">Stay in touch with this open data project! </span></h4><p></p><p><a href=\"http://eepurl.com/djWaFn\" target=\"_blank\"><u>Get on our mailing list</u></a> to stay in touch about this project because we\'re expanding to display more cities\' PB project data over 2018!<br><br>Questions? Feel free to <a href=\"mailto:mypb@participatorybudgeting.org\" target=\"_blank\"><u>contact us.</u></a></p><p></p>',NULL,'2018-02-06 17:21:54','2018-05-11 19:30:05',NULL),(3,'Feedback','This is Feedback page','<script src=\"https://static.airtable.com/js/embed/embed_snippet_v1.js\"></script><iframe class=\"airtable-embed airtable-dynamic-height\" src=\"https://airtable.com/embed/shrGardkjNsxKA6sO?backgroundColor=teal\" frameborder=\"0\" onmousewheel=\"\" width=\"100%\" height=\"1431\" style=\"background: transparent; border: 1px solid #ccc;\"></iframe>',NULL,'2018-04-10 13:57:08','2018-04-18 20:57:29',NULL);
